Http.get = function(url, callback){

let okhttp3 = Packages.okhttp3;

let charset = okhttp3.MediaType.parse("application/x-www-form-urlencoded; charset=utf-8");

let request = new okhttp3.Request.Builder()
.url(url)
.build();

let client = new okhttp3.OkHttpClient.Builder()
.proxy(java.net.Proxy.NO_PROXY)
.build();

let call = client.newCall(request);
//异步GET请求
call.enqueue(new okhttp3.Callback({

onFailure:function(p1, p2){
  let sw = new java.io.StringWriter();
  p2.printStackTrace(new java.io.PrintWriter(sw));
  callback.onError(p1, p2);
},

onResponse:function(p1, p2){
  callback.onResult(String(p2.body().string()), p2.code, p1, p2);
}

}));


};

