function ReadData(path){
try{
var file=new java.io.File(path);
if(file.isFile()){
var out=[];
var line="";
var ins=new java.io.InputStreamReader(new java.io.FileInputStream(file),"UTF-8");
var buff=new java.io.BufferedReader(ins);
while((line=buff.readLine())!=null){
out.push(line);
};
ins.close();
return out.join("\n");
};
}catch(e){
return "";
}
};


